import React from 'react';
import Blog from '../Blog';
import abstract from '../../assets/abstract.png';
import inspired from '../../assets/inspired.png';
import outdoor from '../../assets/outdoor.png';
import perfectArt from '../../assets/perfect-art.png';
import reason from '../../assets/reason.png';
import youngPainters from '../../assets/young-painters.png';
import './Main.css';

function Main() {
  const blogs = [
    {
      img: abstract,
      date: 'May 28, 2020',
      time: '2 mins',
      title: 'The future of abstract art and the culture ...',
      description:
        'Create a blog post suitable that summarises your post in a few short, punchy and sentences and entices your...',
      clapCount: 2,
      liked: false,
    },

    {
      img: inspired,
      date: 'Jan 13, 2019',
      time: '3 mins',
      title: 'The future of abstract art and the culture ...',
      description:
        'Create a blog post suitable that summarises your post in a few short, punchy and sentences and entices your...',
      clapCount: 8,
      liked: true,
    },

    {
      img: outdoor,
      date: 'Feb 10, 2018',
      time: '4 mins',
      title: 'The future of abstract art and the culture ...',
      description:
        'Create a blog post suitable that summarises your post in a few short, punchy and sentences and entices your...',
      clapCount: 3,
      liked: false,
    },

    {
      img: perfectArt,
      date: 'Dec 25, 2017',
      time: '5 mins',
      title: 'The future of abstract art and the culture ...',
      description:
        'Create a blog post suitable that summarises your post in a few short, punchy and sentences and entices your...',
      clapCount: 4,
      liked: false,
    },

    {
      img: reason,
      date: 'Nov 11, 2016',
      time: '6 mins',
      title: 'The future of abstract art and the culture ...',
      description:
        'Create a blog post suitable that summarises your post in a few short, punchy and sentences and entices your...',
      clapCount: 10,
      liked: true,
    },

    {
      img: youngPainters,
      date: 'Oct 1, 2015',
      time: '7 mins',
      title: 'The future of abstract art and the culture ...',
      description:
        'Create a blog post suitable that summarises your post in a few short, punchy and sentences and entices your...',
      clapCount: 1,
      liked: false,
    },
  ];

  return (
    <main>
      {blogs.map((blog, index) => (
        <Blog
          key={index}
          img={blog.img}
          date={blog.date}
          time={blog.time}
          title={blog.title}
          description={blog.description}
          clapCount={blog.clapCount}
          liked={blog.liked}
        />
      ))}
    </main>
  );
}

export default Main;
